def broadcast(message: bytes, sender: socket.socket = "") -> None:
    '''
    broadcasts a message
    '''
    for client in clients:
        if client != sender:
            try:
                client.send(f"PUBLIC:{message}\n".encode())
            except Exception as e:
                print(f"[SERVER] error sending message {e}")
                client.close()
                del clients[client]

